MATCH (p:Patient)-[:HAS_ENCOUNTER]->(e:Encounter)
WHERE e.id = '97018721-ac7a-9252-0dc2-04fdc64bbd0d'
RETURN DISTINCT p.id;

MATCH (payer:Payer {name: 'Medicare'})-[r:HAS_COVERED]-(e:Encounter)-[:HAS_DIAGNOSED]-(i:Immunization)
            WHERE NOT (payer)-[:IS_COVERED_BY]-(i)
            RETURN COUNT(DISTINCT i.code);

MATCH (p:Patient)-[:HAS_ALLERGY]->(a:Allergy)
WHERE a.description = 'Mold (organism)'
RETURN DISTINCT p.firstName, p.lastName;

MATCH (m:Medication), (p:Payer {id: 'b046940f-1664-3047-bca7-dfa76be352a4'})
            WHERE NOT (m)-[:IS_COVERED_BY]->(p)
            RETURN COUNT(DISTINCT m.id);

MATCH (p:Patient)-[:HAS_ENCOUNTER]->(e:Encounter)
WHERE e.reasonDescription = "animal bite"
RETURN e.reasonCode, e.description, p.firstName, p.lastName;

MATCH (p:Patient) 
-[:HAS_HISTORY_OF]->(i:Immunization {description: 'Influenza seasonal injectable preservative free'}) 
RETURN p.firstName, p.lastName;

MATCH (d:Device)-[:IS_ORDERED_DURING]->(e:Encounter)
WHERE d.code = '337414009'
RETURN DISTINCT e.description;

MATCH (p:Payer {name: 'Dual Eligible'})<-[:HAS_COVERED]-(:Encounter)<-[:IS_ORDERED_DURING]-(:Procedure) 
WITH COUNT(DISTINCT p) AS uncovered
RETURN uncovered;

MATCH (p:Payer {name: 'Blue Cross Blue Shield'})-[is_covered_by]->(e:Encounter)--(pr:Procedure) WHERE NOT (p)-[:HAS_COVERED]->(e)
WITH pr, count(pr)
RETURN count(pr);

MATCH (p:Payer {name: 'Dual Eligible'})-[:HAS_COVERED]->(e:Encounter)-[:IS_ORDERED_DURING]->(pr:Procedure)
            WITH COUNT(DISTINCT pr.code) AS num_uncovered_procedures
            RETURN num_uncovered_procedures;

MATCH (p:Patient)-[:HAS_TRANSACTION]->(ct:ClaimTransaction) 
WHERE ct.id = 'fdb84e8a-3e20-b3a8-0cf1-cea85c87cfd2' 
RETURN DISTINCT p.firstName, p.lastName;

MATCH (e:Encounter)-[:IS_COVERED_BY]->(p:Payer {id: 'd18ef2e6-ef40-324c-be54-34a5ee865625'})
            WHERE p.id IS NOT NULL
            RETURN COUNT(DISTINCT e.id);

MATCH (e:Encounter)-[:IS_RESPONSIBLE_FOR]->(o:Organization) 
            WHERE o.id = 'b6eeaaf7-1683-3bcb-b6ee-81ce304636ef'  
            RETURN DISTINCT e.description;

MATCH (e:Encounter)-[:HAS_ORDERED]->(i:ImagingStudy)
WHERE i.seriesUid = '1.2.840.99999999.1.20409606.1674515871722'
RETURN DISTINCT e.description;

MATCH (e:Encounter {id: 'eeb3c5ce-d328-49a1-1abb-9396da4163fd'})-[:HAS_ORDERED]->(ct:ClaimTransaction)
            WITH e, SUM(ct.amount) AS total_claim_cost
            RETURN total_claim_cost;

MATCH (e:Encounter)
WHERE (NOT e)-[:IS_COVERED_BY]->(:Payer {name: 'Anthem'})
RETURN COUNT(e) AS Uncovered_Encounters;

MATCH (p:Patient)-[:HAS_ALLERGY]->(a:Allergy)
WHERE a.code = '84489001'
RETURN DISTINCT p.firstName, p.lastName;

MATCH (payer:Payer {name: "Dual Eligible"})-(covered:Encounter)
WHERE NOT covered.isCovered
RETURN COUNT(DISTINCT covered.id);

MATCH (p:Payer {id: 'b046940f-1664-3047-bca7-dfa76be352a4'})-[:HAS_COVERED]->(m:Medication)
            WHERE NOT (m)-[:IS_COVERED_BY]->(p:Payer)
            RETURN count(DISTINCT m.code);

MATCH (p:Patient)-[:HAS_HISTORY_OF]->(i:ImagingStudy) 
WHERE i.seriesUid = '1.2.840.99999999.1.30162925.1683721997276' 
RETURN p.firstName, p.lastName;

MATCH (e:Encounter)-[:IS_COVERED_BY]->(p:Payer {id: '8fa6c185-e44e-3e34-8bd8-39be8694f4ce'})
            WHERE e.isEnd = TRUE AND NOT p.id IN [e.id]
            RETURN COUNT(e.id);

MATCH (p:Patient)-[:HAS_CLAIM]->(cl:Claim) 
WHERE cl.id = 'cca769d0-09e0-72f9-23aa-e6ddb2200792' 
RETURN p.firstName, p.lastName;
